        fetch(`https://www.ncei.noaa.gov/cdo-web/api/v2/${page}`, "headers: gwomPlwFVOzLJLiCZLQGDAqevULFmWlv")
            .then(res => res.json())
            .then(data => setNoaa(data))
            console.log(noaa)
